import './App.css';
import Header from './components/header/Header';
import Content from './components/content/Contents';
import Footer from './components/footer/Footer';
import Faq from './components/faq/FAQ';

function App() {
  return (
    <div className="App">
      <Header />
      <Content />
      <Footer />
      <Faq />
    </div>
  );
}

export default App;
